style.css:
@-moz-document url-prefix("https://fap.fpt.edu.vn/")
{
  body {
    background-color: black;
  }

  h1 span {
    color: white;
  }

  div.col-md-8 + div.col-md-4 > table {
    display: none !important;
  }

  div.col-md-8 > h1 {
    text-align: center;
  }

  div.col-md-8:has(h1) {
    width: 100%;
  }

  #ctl00_divUser {
    position: absolute !important;
    left: 90%;
    display: none !important;
  }

  #ctl00_lblLogIn {
    display: inline-block !important;
    background-color: red !important;
  }

  #ctl00_mainContent_divMain .box.topAthletes {
    margin-right: 15px !important;
    padding-right: 20px !important;
    margin-left: 25px !important;
  }

  #ctl00_mainContent_divMain div:nth-of-type(2) {
    margin-right: 25px !important;
  }

  div.col-md-12 form ol.breadcrumb {
    display: none;
  }
}
